create table public.fin_base_resultado (
  id bigserial not null,
  data date not null,
  categoria text not null,
  classe text not null,
  codigo text not null,
  descricao text not null,
  valor numeric(15, 2) not null,
  tipo text not null,
  origem_dados text null default 'firebird_sync'::text,
  data_sincronizacao timestamp with time zone null default now(),
  created_at timestamp with time zone null default now(),
  updated_at timestamp with time zone null default now(),
  constraint fin_base_resultado_pkey primary key (id),
  constraint fin_base_resultado_tipo_check check (
    (
      tipo = any (array['Receita'::text, 'Despesa'::text])
    )
  )
) TABLESPACE pg_default;

create index IF not exists idx_resultado_data on public.fin_base_resultado using btree (data) TABLESPACE pg_default;

create index IF not exists idx_resultado_categoria on public.fin_base_resultado using btree (categoria) TABLESPACE pg_default;

create index IF not exists idx_resultado_classe on public.fin_base_resultado using btree (classe) TABLESPACE pg_default;

create index IF not exists idx_resultado_codigo on public.fin_base_resultado using btree (codigo) TABLESPACE pg_default;

create index IF not exists idx_resultado_tipo on public.fin_base_resultado using btree (tipo) TABLESPACE pg_default;

create trigger update_resultado_updated_at BEFORE
update on fin_base_resultado for EACH row
execute FUNCTION fin_update_updated_at_column ();


